path = """



""".split('\n')

def keyboard(x, y, path):
  path_update = {'U': lambda x, y: (x - 1, y), 
                 'D': lambda x, y: (x + 1, y),
                 'L': lambda x, y: (x, y - 1),
                 'R': lambda x, y: (x, y + 1)}
  code = []
  for button_dir in path:
    for side in button_dir:
      new_x, new_y = path_update[side](x, y)
      if 0 <= new_x <= 2 and 0 <= new_y <= 2:
        x, y = new_x, new_y
    code.append(x * 3 + y + 1)
  return code

code = keyboard(1, 1, path)
print(code)
